import React from "react";
import CardData from "./CardData";
import MainCard from "./MainCard";

const Service = () => {
    return (
        <>
            <div className="container">
                <h1>Services</h1>
                <div className="row mx-auto">
                    <div className="col-12 mx-auto" >
                        <div className="row mx-auto">
                                {
                                    CardData.map((val, ind) => {
                                        return <MainCard
                                            key={ind}
                                            title={val.heading}
                                            detail={val.para}
                                            src={val.image}
                                        />
                                    })
                                }
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
};

export default Service;
